import React from "react";
import "./App.css";
import Header from "./component/header/Header";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Router>
        <Header />
        <Switch>
          <Route path="/"><p>i am home</p></Route>
          <Route path="/chat"><p>i am chat</p> </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
